import React from "react";
import "./Home.css";

const Home = () => {
  return (
    <div clas>

      {/*  First home container*/ }

      <div className="homecontainer">
        <div className="headingcontainer">
          <b>
            Lorem ipsum dolor sit amet,<br></br>
            <p className="colorchange">consectrtur adipising elit</p>
          </b>
        </div>
        <div className="textcontainer">
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nunc
          vulputate<br></br>
          libero et velit interdum, ac aliquet odio mattis. Class optent taciti
          sociosqu<br></br>
          ad litora torquent per conubia nostra, per inceptos himenaeos.
          Curabitur<br></br>
          tempus urna at turpis condimentum lobortis. Ut commodo efficitur
          neque.<br></br>
          Ut diam quam, semper iaculis condimentum ac, vestibulum eu nisl.
        </div>
        <div className="btncontainer">
          <button className="learnmorebtn">Learn more</button>
        </div>
      </div>
    </div>
  );
};

export default Home;
